Plot
The story of &quot;Hisss&quot; follows a ruthless American who, fascinated by the ancient folklore of the nagin, travels to India to find out the truth.
In the jungles of India, he captures the mate of the nagin for the magical powers of its nagmani, a mythical gem embedded in its hood. The nagin transforms into a femme fatale and comes to the modern world to track down her lover. She wreaks revenge on those who stand in the way of their reunion and also on her mate's captors.

